export function getEBCorpusMetadataByLanguageCode(languageCode: string): EbibleCorpusMetadata[] {
    if (languageCode === "") {
        return eBibleCorpusMetadata;
    }

    return eBibleCorpusMetadata
        .filter((metadata) => metadata.code === languageCode)
        .map((metadata) => {
            return {
                ...metadata,
                extendedMetadata: [
                    ...extendedEbibleCorpusMetadata.filter(
                        (extMetadata: ExtendedMetadata) =>
                            extMetadata.languageCode === metadata.code
                    ),
                ],
            };
        });
}

export function getExtendedEbibleMetadataByLanguageNameOrCode(
    languageName?: string,
    languageCode?: string
): ExtendedMetadata[] {
    return extendedEbibleCorpusMetadata.filter((metadata) => {
        if (languageName) {
            return metadata.languageName === languageName;
        }
        if (languageCode) {
            return metadata.languageCode === languageCode;
        }
        return false;
    });
}

export interface EbibleCorpusMetadata {
    file: string;
    code: string;
    lang: string;
    family: string;
    country: string;
    Total: number;
    Books: number;
    OT: number;
    NT: number;
    DT: number;
}

export interface ExtendedMetadata {
    languageCode: string;
    translationId?: string | null;
    languageName?: string | null;
    languageNameInEnglish?: string | null;
    dialect?: string | null;
    homeDomain?: string | null;
    title?: string | null;
    description?: string | null;
    Redistributable?: boolean | null;
    Copyright?: string | null;
    UpdateDate?: string | null;
    publicationURL?: string | null;
    OTbooks?: number | null;
    OTchapters?: number | null;
    OTverses?: number | null;
    NTbooks?: number | null;
    NTchapters?: number | null;
    NTverses?: number | null;
    DCbooks?: number | null;
    DCchapters?: number | null;
    DCverses?: number | null;
    FCBHID?: string | null;
    Certified?: boolean | null;
    inScript?: string | null;
    swordName?: string | null;
    rodCode?: number | null;
    textDirection?: string | null;
    downloadable?: boolean | null;
    font?: string | null;
    shortTitle?: string | null;
    PODISBN?: string | null;
    script?: string | null;
    sourceDate?: string | null;
}

